// ‡∏ü‡∏±‡∏á‡∏Å‡πå‡∏ä‡∏±‡∏ô‡∏Å‡∏£‡∏≠‡∏á‡∏Ç‡πâ‡∏≠‡∏°‡∏π‡∏•‡∏ã‡πâ‡∏≥
function removeDuplicates(customers) {
  const seen = new Set();
  const uniqueCustomers = [];
  
  for (const customer of customers) {
    // ‡∏™‡∏£‡πâ‡∏≤‡∏á key ‡∏à‡∏≤‡∏Å‡∏ä‡∏∑‡πà‡∏≠ + ‡∏ô‡∏≤‡∏°‡∏™‡∏Å‡∏∏‡∏• + ‡πÄ‡∏•‡∏Ç‡∏ö‡∏±‡∏ï‡∏£‡∏õ‡∏£‡∏∞‡∏ä‡∏≤‡∏ä‡∏ô + ‡πÄ‡∏ö‡∏≠‡∏£‡πå‡πÇ‡∏ó‡∏£
    const key = `${customer.name}${customer.surname}${customer.id_card}${customer.phone}`;
    
    if (!seen.has(key)) {
      seen.add(key);
      uniqueCustomers.push(customer);
    } else {
      console.log(`‚ö†Ô∏è  ‡∏Ç‡πâ‡∏≠‡∏°‡∏π‡∏•‡∏ã‡πâ‡∏≥: ${customer.name} ${customer.surname} (${customer.phone})`);
    }
  }
  
  return uniqueCustomers;
}

